import React from "react";
import "./JobCards.css";

const JobCards = ({ jobs }) => {
  return (
    <div className="job-cards">
      {jobs.map((job, index) => (
        <div className="card" key={index}>
          <h3>{job.title}</h3>
          <p>{job.company}</p>
          <p>{job.location}</p>
        </div>
      ))}
    </div>
  );
};

export default JobCards;
